import React, { useEffect, useRef } from 'react';
import Typed from 'typed.js';

const Navbar = () => {
    const el = useRef(null); // Create a ref

    useEffect(() => {
        const typed = new Typed(el.current, {
            strings: ['We help you find study buddies!'],
            typeSpeed: 50,
            backSpeed: 50,
            loop: true,
        });

        // Clean up on unmount
        return () => {
            typed.destroy();
        };
    }, []);

    return (
        <div className="bg-blue-600 text-white py-4 text-center shadow-lg">
            <h1 className="text-3xl font-bold mb-2">Welcome to Study Buddy</h1>
            <p className="text-xl" ref={el}></p>
        </div>
    );
};

export default Navbar;
